import { Layout, Breadcrumb } from 'antd';
import MyContent from '../homeLayout/myContent'

const List = (props) => {
    console.log(props);
    return (
        <MyContent>
            <ul>
                {
                    props.shows.data.list.map((ele) => {
                        return (
                            <li>{ele.ironDir}</li>
                        )
                    })
                }
            </ul>
        </MyContent>
    )
}

List.getInitialProps = async function () {
    const res = await fetch('https://worker-api.wanshifu.com/master/listinfo');
    const data = await res.json();
    return {
        shows: data
    }
}

export default List
